import axiosInstance from '../config/axiosInstance';
import {
  socialLoginInitiated,
  // socialLoginSuccess,
} from './actionCreators';

// function endSocialLogin (token) {
//   return {
//     type: 'End_Social_Login',
//     token:token,
//   };

const googleAuth = (serviceProvider, userData) => {
  dispatch(socialLoginInitiated());
  return axiosInstance.post(serviceProvider, userData)
    .then((res) => {
      console.log('res', res);
      // localStorage.setItem('token', result.data.user.access_token);
      // dispatch(socialLoginSuccess(res));
    })
    .catch((error) => error);
};

export default googleAuth;
